import React from 'react';
import ReactDOM from 'react-dom';
import Levels from './Levels';

function Congrats() {
    document.cookie = "completed=true";
    return(
        <div className="container">
            <div className="Congrats">
                <h3>Congratulations! You completed all available levels!</h3>
                <h4>More levels to come soon.</h4>
                <button onClick={document.window.reload()}>Home</button>
                <button onClick={_ => ReactDOM.render(<React.StrictMode><Levels /></React.StrictMode>, document.getElementById("root"))}>Levels</button>
            </div>
        </div>
    )
}

export default Congrats;
